import React from 'react';
import '../App.css';
import VerticalDivider from './VerticalDivider';
import '../assets/css/footer.css';
import Behance from '../media/behance-logo.png';
import Github from '../media/github-mark.png';
import LinkedIn from '../media/linkedin-icon.png';
import Divider from '@material-ui/core/Divider'; 

function Footer() {
  
    return (
      <div className="divFooter">
        
          <div className="footerIcons">
          <img src={LinkedIn} className="socialIcons" alt="Linkedin" />
            <img src={Github} className="socialIcons" alt="Github" />
            <img src={Behance} className="socialIcons" alt="Behance" />
            
          </div>
         
          <VerticalDivider />
      </div>
      
    );
  }
  
  export default Footer;
